import { useEffect, useRef } from "react";
import { motion } from "framer-motion";
import IMAGE1 from '../Images/IMAGE1.png';

const Home = (props) => {
    const button = useRef(null);

    useEffect(() => {
        if (props.isDark) {
            button.current.classList.add('text-white');
            button.current.classList.remove('text-black');
        } else {
            button.current.classList.remove('text-white');
            button.current.classList.add('text-black');
        }
    } ,[props.isDark]);

    return (
        <>
            <motion.div
                initial={{opacity: 0, y: 50}} 
                animate={{opacity: 1, y: 0}} 
                transition={{duration: 2, ease: "easeOut"}}
            >
                <div>

                </div>
                
                <img className="inline w-[100px]" src={IMAGE1} />
            </motion.div>

            <motion.div
                initial={{opacity: 0, y: 50}} 
                animate={{opacity: 1, y: 0}} 
                transition={{duration: 2, ease: "easeOut"}}
            >
                <p className="pl-[200px] pt-[200px] font-bold text-3xl">What is TEMPO?</p>
            </motion.div>
        </>
    );
};

export default Home;
